gK1:function(){return"En 2008, quelqu'un sous le pseudonyme de Satoshi Nakamoto a partag\xe9 avec le reste du monde sa vision d'un nouveau type de monnaie.\n\nSatoshi a d\xe9crit dans son article acad\xe9mique \"Bitcoin : A Peer-to-Peer Electronic Cash System\" un nouveau syst\xe8me pour les transactions num\xe9riques qui ne serait pas contr\xf4l\xe9 de mani\xe8re centralis\xe9e par une entreprise ou un gouvernement. Un syst\xe8me qui n'aurait pas besoin d'une tierce partie de confiance.\n\nUn syst\xe8me contr\xf4l\xe9 par personne mais par des r\xe8gles math\xe9matiques complexes suivies par un r\xe9seau d\xe9centralis\xe9 d'ordinateurs.\n\nIl a apport\xe9 au monde deux caract\xe9ristiques tr\xe8s pr\xe9cieuses : la finalit\xe9 de la transaction et la raret\xe9 ultime.\n\nBitcoin est devenu un moyen radicalement nouveau de faire des transactions et de stocker de la valeur partout dans le monde. Il a r\xe9volutionn\xe9 la fa\xe7on dont nous pouvions effectuer des transactions sur l'internet.\n\nLe Bitcoin conserve sa valeur car il s'agit d'un actif rare, un peu comme l'or. Cependant, il n'y aura jamais plus que 21 millions de Bitcoin, ou 2,1 quadrillions de Satoshi. 1 Bitcoin = 100 000 000 Satoshi (tout comme 1 euro = 100 cents).\n\nLes puissants r\xe9seaux informatiques d\xe9pensent de l'\xe9nergie \xe0 r\xe9soudre des probl\xe8mes math\xe9matiques difficiles pour s\xe9curiser le syst\xe8me, et sont donc r\xe9mun\xe9r\xe9s pour leur travail avec des bitcoins nouvellement frapp\xe9s. C'est ce que les gens appellent l'exploitation mini\xe8re (ou preuve de travail).\n\nCes ordinateurs traitent les transactions en formant un enregistrement dans un nouveau type de base de donn\xe9es constitu\xe9 d'une cha\xeene de blocs, d'o\xf9 le nom de blockchain. Le grand livre ne peut pas \xeatre modifi\xe9 sans refaire tout le travail depuis le d\xe9but. Cela serait tr\xe8s co\xfbteux et pratiquement impossible \xe0 faire.\n\nTout ordinateur peut t\xe9l\xe9charger la cha\xeene de blocs et v\xe9rifier toutes les transactions depuis le d\xe9but, en maintenant l'int\xe9grit\xe9 du grand livre Bitcoin. Tout le monde peut participer au r\xe9seau pour s'assurer que les r\xe8gles du jeu sont respect\xe9es et confirmer le propri\xe9taire l\xe9gitime de chaque bitcoin. Vous devenez ainsi votre propre banque.\n\nMais comment obtenir des bitcoins ? Certaines personnes extraient des bitcoins et d'autres les ach\xe8tent sur des bourses r\xe9glement\xe9es, tout comme Stack. D'autres les ach\xe8tent entre eux, en personne ou en ligne.\n\nComme l'offre de bitcoin est limit\xe9e, son prix fluctue principalement en fonction de la demande. Mais contrairement \xe0 l'or, lorsque la demande augmente, l'offre de Bitcoin reste fix\xe9e \xe0 21 millions. Cela rend le bitcoin tr\xe8s d\xe9sirable.\n\nMais o\xf9 gardez-vous vos bitcoins ? Certaines personnes choisissent de les stocker sur leur ordinateur ou leur t\xe9l\xe9phone, et d'autres sur un mat\xe9riel sp\xe9cialis\xe9. Et ceux qui ne veulent pas s'en soucier peuvent de nouveau laisser les d\xe9positaires r\xe9glement\xe9s, comme Stack, le faire \xe0 leur place.\n\nQuoi que vous fassiez, vos bitcoins ont une grande valeur. Alors assurez-vous de les garder en s\xe9curit\xe9.\n\nPeut-\xeatre qu'un jour, les bitcoins deviendront la monnaie pr\xe9f\xe9r\xe9e du monde, mais ce qui est s\xfbr, c'est qu'ils ont lanc\xe9 un mouvement mondial vers l'adoption d'une nouvelle forme de monnaie. Une monnaie o\xf9 chacun peut librement \xe9changer des valeurs entre eux."},
